import React from 'react';
import './style.scss';

const IconList = ({item}) => {
    return (
        <div className='P-icon-list-box'>
                <div className='G-flex-column'>
                        <p>100 Awesome Nucleo Icons</p>
                        <p>Handcrafted by our friends from NucleoApp</p>
                </div>
            <span className={item.icon1}></span>
            <span className={item.icon2}></span>
            <span className={item.icon3}></span>
            <span className={item.icon4}></span>
            <span className={item.icon5}></span>
            <span className={item.icon6}></span>
            <span className={item.icon7}></span>
            <span className={item.icon8}></span>
            <span className={item.icon9}></span>
            <span className={item.icon10}></span>
            <span className={item.icon11}></span>
            <span className={item.icon12}></span>
            <span className={item.icon13}></span>
            <span className={item.icon14}></span>
            <span className={item.icon15}></span>
        </div>
    );
};

export default IconList;
